import React, { useEffect, useState } from "react";
import { GoogleApiWrapper, Map, Marker } from "google-maps-react";

export class MapContainer extends React.Component {
  state = { center: { lat: 37.85, lng: -122.541 }, markers: null };

  clickMarker = (props, marker) => {
    console.log(props.placeId);
  };



  componentDidMount() {
    var myHeaders = new Headers();
    // myHeaders.append("Authorization", "Bearer --Token Here--");
    myHeaders.append(
      "Authorization",
      "Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9...."  // Your token here
    );

    var requestOptions = {
      method: 'GET',
      headers: myHeaders,
      redirect: 'follow'
    };

    fetch("https://api.iq.inrix.com/lots/v3?point=37.74638779388551%7C-122.42209196090698&radius=1000", requestOptions)
      .then(response => response.json())  // Parse the response as JSON
      .then(data => {
        const parsedMarkers = data.map(item => ({
          place_id: item.place_id,
          position: {
            lat: item.latitude,
            lng: item.longitude,
          }
        }));

        this.setState({ markers: parsedMarkers });
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }


    render() {
        const { google } = this.props;

    return <Map
            google={google} 
            center={{
                lat: 37.85,
                lng: -122.541
            }} 
            onReady = {this.fetchPlaces}
            style={{ height: "100%", position: "relative", width: "100%" }}
            zoom={8}>
                {this.state.markers != null &&
                this.state.markers.map(coords => (
                <Marker
                    key={coords.place_id}
                    position={coords.geometry.location}
                    onClick={this.clickMarker}
                    placeId={coords.place_id}
                />
                ))}
            </Map>;
  }
}

export default GoogleApiWrapper({
  apiKey: "AIzaSyDrcb7m1SF9y8PMHuiC1JzRg2emyaRZJTg"
})(MapContainer);
